{"title":"100_last","type":"vega","aggs":[],"params":{"spec":"{
  $schema: https://vega.github.io/schema/vega-lite/v5.json
  title: scatter lon and lat
  mark: {"type": "point", "tooltip": true}
  data: {
    url: {
      index: taxi_service_index
      body: {
        size: 100
        sort : {"Date/Time": "asc"}
        _source: ["Lon", "Lat"]
        "query" : {
            "match_all" : {}
        }
      }
    }
    format: {property: "hits.hits"}
  }
  params: [{
    name: "grid",
    select: "interval",
    bind: "scales"
  }],
  transform: [
    // Since @timestamp is a string value, we need to convert it to a unix timestamp
    // so that Vega can work on it properly.
    {
      // Convert _source.@timestamp field to a date
      calculate: "max(datum._source['Lon'])"
      // Store the result in a field named "time" in the object
      as: "max_lon"
    }
    {
      // Convert _source.@timestamp field to a date
      calculate: "min(datum._source['Lon'])"
      // Store the result in a field named "time" in the object
      as: "min_lon"

    }
    {
      // Convert _source.@timestamp field to a date
      calculate: "max(datum._source['Lat'])"
      // Store the result in a field named "time" in the object
      as: "max_lat"
    }
    {
      // Convert _source.@timestamp field to a date
      calculate: "min(datum._source['Lat'])"
      // Store the result in a field named "time" in the object
      as: "min_lat"
    }
  ]
  encoding: {
    x: {field: "_source.Lat", type: "quantitative", title: "Lat",
    //scale: { domain: ['min_lat', 'max_lat'] }
    scale: {domain: [39.9896, 41.3184]}
    }
    y: {field: "_source.Lon", type: "quantitative", title: "Lon",
    //scale: { domain: ['min_lon', 'max_lon'] }
    scale: {domain: [-74.7737, -72.7162]}
    }
    tooltip: [
      {"field": "_source.Lat", "type": "quantitative", "title": "Lat"}
      {"field": "_source.Lon", "type": "temporal", "title": "Lon"}
    ]
  }
}"}}

{"title":"most requested area","type":"vega","aggs":[],"params":{"spec":"{
  $schema: https://vega.github.io/schema/vega-lite/v5.json
  title: most requested area​​​​​
  //config: {kibana: {hideWarnings: true}}
  params: [
    {
      "name": "highlight",
      "select": {"type": "point", "on": "mouseover"}
    },
    {"name": "select", "select": "point"}
  ]
  // Define the data source
  data: {
    url: {

      // Apply dashboard context filters when set
      // Filter the time picker (upper right corner) with this field
      // Which index to search
      index: taxi_service_index
      body: {
        aggs: {
          "geo": {
            "geohash_grid": {
              "field": "Location",
              "precision": 7,
              "size": 10
            },
            "aggs": {
              "point": {
                "geo_centroid": {
                  "field": "Location"
                }
              }
            }
          }
        }
      }
    }

    format: {property: "aggregations.geo.buckets"}
  }
  transform: [
    {"calculate": "'('+ substring(toString(datum.point.location.lat), 0, 8) + ', '+ substring(toString(datum.point.location.lon), 0, 8)+')'", "as": "geopoint"}
  ]
  mark: {
    type: "bar",
    fill: "#6c8f46",
    stroke: "black",
    cursor: "pointer"
  },
  encoding: {
    x: {
      field: geopoint
      type: nominal
      axis: {title: "locations"} // Customize X axis format
    }
    y: {
      field: doc_count
      type: quantitative
      axis: {title: "request count"}
    }
    //"color": {"value": "#6c8f46"}

  "fillOpacity": {
      "condition": {"param": "select", "value": 1},
      "value": 0.3
    },
    "strokeWidth": {
      "condition": [
        {
          "param": "select",
          "empty": false,
          "value": 2
        },
        {
          "param": "highlight",
          "empty": false,
          "value": 1
        }
      ],
      "value": 0
    }
  }
}
"}}

